import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Chat from './Chat'
import Login from './Login.js'
function App() {
  return (
    <Router>
      <div className="container-sm">
        <Routes>
          <Route path="/" element={<Login />} />
        </Routes>
      </div>
    </Router>
  );
}


export default App;
